import request from "@/utils/axiosRequest"
import axios from "axios";
const cancelToken = axios.CancelToken.source();
export function sendToGPT(data) {
  return request({
    url: `/sendToGPT`,
    method: 'post',
    data: data,
    cancelToken: cancelToken.token
  })
}
